styles.content:
self {
  display : flex;
  flex-direction : row;
  gap : 20px;
  padding-top : 10px;
  padding-right : 0px;
  padding-bottom : 10px;
  padding-left : 20px;
  border-top-right-radius : 15px;
  border-bottom-right-radius : 15px;
	cursor : pointer
}

self:hover{
  background-color: #ef7b63;
}

self .fd-statictext {
  color : #929292;
}

self .fd-icon {
  color: #929292;
}

self:hover .fd-statictext {
  color: white;
	 font-weight : 700;
}

self:hover .fd-icon {
  color: white
}

self {
  display : inline;
  background-color : transparent;
  color : #ef7b63;
  border-color : #ef7b63;
  border-width : 1px;
}

self:hover {
  background-color :  #ef7b63;
	color : white;
}

self {
  background-color : #efefef;
  border-radius : 20px;
  display : flex;
  flex-direction : column;
  gap : 18px;
  padding-top : 15px;
  padding-right : 15px;
  padding-bottom : 15px;
  padding-left : 15px;
	width: 400px;
	min-width: 200px;
	max-width: 500px;
}

self {
  background-color : #efefef;
  border-radius : 20px;
  display : flex;
  flex-direction : column;
  padding-top : 15px;
  padding-right : 15px;
  padding-bottom : 15px;
  padding-left : 15px;
}

self {
  border-radius: 10px;
	background-color: #e6e6e6;
}

self .header .header-cell {
  background-color: transparent;
  color: #5e5e5e;
  font-weight: bold;
  padding: 1.25rem 2rem;
}

self .row {
  align-items: center;
}

self .row .cell {
  padding: 0.5rem 2rem;
}

self .row .cell > span {
  justify-content: flex-start;
}

self .row.selected {
  background-color: #d2d7f5;
}

self .row-even:not(.selected):not(:hover) {
  background-color: #f2f2f2;
}

self .header .resizable > :not([hidden]) ~ :not([hidden]),
self .row > :not([hidden]) ~ :not([hidden]),
self .Grid .innerScrollContainer,
self .Grid .innerScrollContainer > :not([hidden]) ~ :not([hidden]) {
  border-width: 0;
}

self {
  display : flex;
  flex-direction : row;
  padding-top : 10px;
  padding-right : 20px;
  padding-bottom : 10px;
  padding-left : 20px;
  flex-wrap : wrap;
  align-content : flex-start;
  justify-content : space-around;
	overflow: hidden;

}

